define('text!views/widgets/user-edit.html', ['module'], function(module) { module.exports = "<template>\r\n  <require from=\"../widgets/form-input\"></require>\r\n\r\n  <div class=\"hdr-wrap\">\r\n    <h1 class=\"hdr-inline\">${title}<span class=\"html-file-name\">(user-edit.html)</span></h1>\r\n  </div>\r\n\r\n  <div class=\"panel panel-primary bg-light margin-x-0\">\r\n    <div class=\"panel-body row\">\r\n      <form role=\"form\" class=\"form-horizontal\">\r\n\r\n        <form-input name=\"firstName\" model.bind=\"user.firstName\"></form-input>\r\n        <form-input name=\"lastName\" model.bind=\"user.lastName\" inp-label=\"Last Name\"></form-input>\r\n        <form-input name=\"email\" model.bind=\"user.email\" inp-label=\"Email\"></form-input>\r\n        <form-input name=\"phoneNumber\" model.bind=\"user.phoneNumber\" inp-label=\"Telephone\"></form-input>\r\n\r\n        <!--<div repeat.for=\"elem of editUser\">\r\n          <p>${elem.name} / ${elem.val} / ${elem.label} / ${parent.editUser[$index].val}</p>\r\n          <form-input name=\"${elem.name}\" model.bind=\"elem\" inp-label=\"${elem.label}\"></form-input>\r\n        </div>-->\r\n\r\n      </form>\r\n    </div>\r\n  </div>\r\n\r\n</template>"; });
define('text!views/widgets/user-list.html', ['module'], function(module) { module.exports = "<template>\r\n\r\n    <div class=\"hdr-wrap\">\r\n        <h1 class=\"hdr-inline\">${title}<span class=\"html-file-name\">(user-list.html)</span></h1>\r\n        <a class=\"btn btn-default btn-i pull-right\" route-href=\"route: user-add\">\r\n            <i class=\"fa fa-plus\"></i>Add User\r\n        </a>\r\n    </div>\r\n\r\n\r\n    <!--<h2 if.bind=\"custDisableCells\">custDisableCells: ${custDisableCells}</h2>-->\r\n\r\n    <table class=\"table table-striped\" aurelia-table=\"data.bind: users; display-data.bind: $displayData\">\r\n        <thead>\r\n            <tr>\r\n                <th if.bind=\"isNotDisabled('id')\">id</th>\r\n                <th if.bind=\"isNotDisabled('fName')\">First Name</th>\r\n                <th if.bind=\"isNotDisabled('lName')\">Last Name</th>\r\n                <th if.bind=\"isNotDisabled('email')\">E-mail</th>\r\n                <th if.bind=\"isNotDisabled('telephone')\">Telephone</th>\r\n                <th if.bind=\"isNotDisabled('permission')\">Permission</th>\r\n                <th if.bind=\"isNotDisabled('edit')\">Edit</th>\r\n            </tr>\r\n        </thead>\r\n        <tbody>\r\n            <tr repeat.for=\"user of users\" class=\"${user.id === $parent.selectedId ? 'active' : ''}\">\r\n                <td if.bind=\"isNotDisabled('id')\">${user.id}</td>\r\n                <td if.bind=\"isNotDisabled('fName')\">${user.firstName}</td>\r\n                <td if.bind=\"isNotDisabled('lName')\">${user.lastName}</td>\r\n                <td if.bind=\"isNotDisabled('email')\"><a href=\"mailto:${user.email}\">${user.email}</a></td>\r\n                <td if.bind=\"isNotDisabled('telephone')\"><a href=\"tel:${user.phoneNumber}\">${user.phoneNumber}</a></td>\r\n                <td if.bind=\"isNotDisabled('permission')\">${user.permission}</td>\r\n                <td if.bind=\"isNotDisabled('edit')\">\r\n                    <a route-href=\"route: users; params.bind: {id:user.id}\" title=\"Quick edit\">\r\n                        <i class=\"fa fa-pencil\"></i>\r\n                    </a>\r\n                    <a route-href=\"route: users; params.bind: {id:user.id}\" title=\"Full edit\" class=\"margin-left-1\">\r\n                        <i class=\"fa fa-list\"></i>\r\n                    </a>\r\n                </td>\r\n            </tr>\r\n        </tbody>\r\n    </table>\r\n</template>"; });
